import React, { Component } from 'react';
import { connect } from 'react-redux';

import FormField from '../Utils/Form/FormField';
import { update, generateData, isFormValid } from '../Utils/Form/FormAction';
import { loginUser } from '../../actions/user_action' 

class Register extends Component {
	state = {
		formError: false,
		formSuccess: '',
		formData: {
			name: {
				element: 'input',
				value: '',
				config: {
					name: 'name_input',
					type: 'text',
					placeholder: 'Enter your name'
				},
				validation: {
					required: true,
					email: false
				},
				valid: false,
				touched: false,
				validationMessage:''
			},

			lastname: {
				element: 'input',
				value: '',
				config: {
					name: 'email_input',
					type: 'text',
					placeholder: 'Enter your lastname'
				},
				validation: {
					required: true,
					email: false
				},
				valid: false,
				touched: false,
				validationMessage:''
			},

			email: {
				element: 'input',
				value: '',
				config: {
					name: 'email_input',
					type: 'email',
					placeholder: 'Enter your email'
				},
				validation: {
					required: true,
					email: true
				},
				valid: false,
				touched: false,
				validationMessage:''
			},

			password: {
				element: 'input',
				value: '',
				config: {
					name: 'password_input',
					type: 'password',
					placeholder: 'Enter your password'
				},
				validation: {
					required: true,
					email: false
				},
				valid: false,
				touched: false,
				validationMessage:''
			},

			comfirmPassword: {
				element: 'input',
				value: '',
				config: {
					name: 'confirm_password_input',
					type: 'password',
					placeholder: 'Confirm your password'
				},
				validation: {
					required: true,
					email: false,
					confirm: 'password'
				},
				valid: false,
				touched: false,
				validationMessage:''
			}

		}
	}

  render() {
    return (
      <div className='page_wrapper'>
      	<div className='container'>
      		<div className='register_login_container'>
      			<div className='left'>
      				<form onSubmit={(event)=> this.submitForm(event)} >
      					<h2>
      						Personal Information
      					</h2>

      					<div className='form_block_two'>
      						<div className='block'>
      							<FormField 
					      			id={'name'}
					      			formData={this.state.formData.name}
					      			change={(element)=> this.updateForm(element)}
					      		/>

					      	</div>
					      	<div className='block'>
					      		<FormField 
					      			id={'lastname'}
					      			formData={this.state.formData.lastname}
					      			change={(element)=> this.updateForm(element)}
					      		/>

					      	</div>


      					</div>
      				</form>
      			</div>

      		</div>
      	</div>
      </div>
    )
  }
}

export default connect()(Register);
